import { Link } from 'react-router-dom';
import "./SecondPage.css";

const SecondPage = () => (
  <div className={"secondpag " + className}>
  <div className="content-wrapper">
  <img className="logo" src="songASLlogo.png" alt="Logo" onClick={goToHome} style={{cursor:'pointer'}}></img>
      <motion.div
      initial={{ opacity: 0 }}
      animate={{ opacity: 1 }}
      transition={{ duration: 0.5, delay: 0.1 }}
      className="yt"
      >First, learn the song in ASL by watching the video below!</motion.div>
      <div className="videoiframe">
      <YoutubeEmbed embedId="rokGy0huYEA" />
      </div>
      <Link to="/second-page">
      <div className="dp"> Now, are you ready for a challenge?</div>
        </Link>

      <div className="buttoncont">
      <button className="todetect" onClick={goToDetectionPage}>Click to start signing!</button>
      </div>
  </div>
</div>

);


export default SecondPage;
